import React, { Component } from "react";
import Table from "./common/table.component";

class Movies extends React.Component {
    state = {
        headers: ['ID', 'First Name', 'Last Name', 'Handle'],
        movies: [
            {id: 1, first_name: 'Mark', last_name: 'Otto', handle: '@mdo'},
            {id: 2, first_name: 'Jacob', last_name: 'Thornton', handle: '@fat'},
            {id: 3, first_name: 'Larry', last_name: 'the Bird', handle: '@twitter'},
        ]
    }
  render() {
      const column = [
          {label: 'ID', path: 'id', content: item => { <td>{item}</td> }},
          {label: 'First Name', path: 'first_name', content: item => { <td>{item}</td> }},
          {label: 'Last Name', path: 'last_name', content: item => { <td>{item}</td> }},
          {label: 'Handle', path: 'handle', content: item => { <td>{item}</td> }}
      ]
    return (
      <>
        <Table headers={this.state.headers} data={this.state.movies}/>
      </>
    );
  }
}

export default Movies;
